                body:
                  "# 0.12.1\n\n## New Features\n\n- PullRequest can now be created\
                  \ also between two different forks of\n  a project. (@mfocko)\n- PullRequests\
                  \ have a `patch` property now when working with Pagure. (@jpopelka)\n\
                  - You can now add collaborators with specific privileges on GitHub and\n\
                  \  GitLab projects. (@shreyaspapi)\n\n## Minor\n\n- When telling if\
                  \ a user can merge PRs in a GitHub repo, ogr asks GitHub\n  for the\
                  \ user's permission on the repo instead of checking if the user is\n\
                  \  in the list of collaborators. (@csomh)\n\n## Fixes\n\n- `get_project()`\
                  \ will now correctly use the service instance class for custom.\n  service\
                  \ instances. (@lachmanfrantisek)\n"
