                  "# 0.2.0\n\n### New Features\n\n* GithubProject now fully supports\
                  \ all the forking-related methods.\n* GitProject class now has a parent\
                  \ property to get the original GitProject of\n  a fork.\n* Methods related\
                  \ to forking received usability updates: they should be now\n  easier\
                  \ to work with and you'll need to write less code.\n* The upstream project\
                  \ now has a CONTRIBUTING.md file. All your contributions are\n  welcome!\n\
                  \n## Fixes\n\n* New github pull request now link to the URL on web interface\
                  \ instead of API.\n\n## Minor\n\n* We have implemented multiple tools\
                  \ to increate code quality: coverage, black, pre-commit, mypy, flake8\n\
                  \  * All of them run in CI as well.\n\n"
